import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
//import axios from 'axios'; 
function QueryList() {
    const [queries, setQueries] = useState([]);
    useEffect(() => {
        fetchData();
    }, []);
    const fetchData = async () => {
        try{ const onSubmit = async (values) => {
          alert(JSON.stringify(values));
        };
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };
    return (
        <div>
        <div className="bg-secondary border-top p-5 text-white mb-3">
              <Link to="/">
                <img alt="logo" src="../../images/(0).png" style={{ marginLeft : "150px", height: "44px", width: "159px" }} />
              </Link>
          <h1 className="display-6 text-center" style={{marginTop: "-45px"}}>Query List</h1>
          <button className="btn btn-dark btn-block float-end" style={{marginTop: "-45px"}}>
                <Link to="/account/signinadmin" className="text-white" style={{color : "white", textDecoration : "none", fontSize : "18px"}}>
                  Logout
                </Link>
              </button>
        </div>
        <div style={{padding:"40px"}}>
            <div className="table-responsive" >
                <table className="table table-striped table-bordered table-hover table-condensed color-white" style={{backgroundColor:"black",width:"100%", align:"center"}}>
                    <thead>
                        <tr>
                            <th style={{backgroundColor:"black",color:"white"}}><center>Query No.</center></th>
                            <th style={{backgroundColor:"black",color:"white"}}><center>Email</center></th>
                            <th style={{backgroundColor:"black",color:"white"}}><center>Message</center></th>
                            <th style={{backgroundColor:"black",color:"white"}}><center>Is_Answered</center></th>
                        </tr>
                    </thead>
                    <tbody>
                        {queries.map(query => (
                            <tr key={query.qno}>
                                <td><center>{query.qno}</center></td>
                                <td><center>{query.email}</center></td>
                                <td><center>{query.sub}</center></td>
                                <td><center>{query.msg}</center></td>
                                <td><center>{query.ans}</center>
                                        <input type="button" value="Update" className="btn btn-primary btn-md text-white" style={{ marginLeft: '30px', backgroundColor: 'rgb(36 106 175)' }} />
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
        </div>
    );
}
export default QueryList;
